import { Navbar, NavbarBrand} from 'reactstrap'


const Sitebar = (props) => {
  return ( 
    <Navbar color="faded" expand="md">
      <NavbarBrand href="/">Beer Log</NavbarBrand>
    </Navbar>
   );
}

export default Sitebar;
